This is a celebration for the culture!
A celebration of the past, the present, the future and the youth of this generation! As we move forward through challenging times, we must take time to celebrate and honor all of those who have come before us. SANKOFA! We must continue to dance, sing, laugh and create the beauty, reality and communities we wish to see thrive!
We are the Revolution! Dedicated to all the ancestors, griots and leaders that came before us! Ase!
